$(document).ready(function(){$("div.twitter-embed").each(function(b){var a=$(this).attr("data-url");var c=$(this);$.ajax({url:"https://api.twitter.com/1/statuses/oembed.json?url="+a,dataType:"jsonp",success:function(d){c.html(d.html)}})})});$(document).ready(function(){$("div.soundcloud-embed").each(function(b){var a=$(this).attr("data-url");var c=$(this);$.getJSON("https://soundcloud.com/oembed?callback=?",{format:"js",url:a,iframe:true},function(d){c.html(d.html)})})});